	# Set the interpolation function
	Yarns[i].AssignInterpolation(CInterpolationBezier())
	Yarns[i].AssignSection(YarnSection[i])
	# Set the resolution of the surface mesh created
	Yarns[i].SetResolution(20)
	# # Add the yarn to textile
	Textile.AddYarn(Yarns[i])
