################################################## 
# Create a domain and assign it to the textile
Textile.AssignDomain(CDomainPlanes(XYZ(-515, 0, 0),XYZ(0, 140, 110)))
# Add the textile with the name "Reconstruction"
AddTextile("Reconstruction", Textile)
#turn off domain rendering
window = GetRenderWindow()
window.RemoveDomains()


################################################## 
# save node data

with open ('ouputfile.txt', 'w') as f: ## write output file

	for n in range(len(Yarns)):
		## extract node data
		MNodes=Yarns[n].GetMasterNodes()
		nNodes=Yarns[n].GetNumNodes()
		Interp=Yarns[n].GetInterpolation()
		
		for i in range(nNodes-1):
			SNode=Interp.GetNode(MNodes, i, 0) #slave node
			pos = SNode.GetPosition()
			orient=SNode.GetTangent()
			
			#write yarn number, position (x,y,z) and orientation
			f.writelines(str(n) + ", " + str(pos) + ", " + str(orient) + "\n")
			
			if i == max(range(nNodes-1)): #last node needs to be interpolated from the previous
				SNode=Interp.GetNode(MNodes, i, 1) #slave node
				pos = SNode.GetPosition()
				orient=SNode.GetTangent()
				#write yarn number, position (x,y,z) and orientation
				f.writelines(str(n) + ", " + str(pos) + ", " + str(orient) + "\n")
	
f.closed